export function Button(props) {
  console.log("props di button", props);

  const { children = "Click me!", title } = props;

  const log = () => {
    console.log("Hello world!");
  };

  return (
    <button
      aria-label="Click me and show a console log"
      className={`btn`}
      onClick={log}
      title={title}
    >
      {children}
    </button>
  );
}
